export function GetPrediction (model, sample)
{
	if (model == null)
		return -1;
	if (sample == null)
		return -2;
	let file = new File ("./data/" + sample);
	//if (! file.exists())
		//return -3;
	sleep (1);
	return Math.round (Math.random() * 100);
}
